column8:
　高品質モジュール及び超高輝度素子を採用することにより圧倒的な光量と照射角を実現。従来のバルブではなしえなかった抜群の視認性と省電力、超寿命をご体感下さい。取り付けスペースのクリアランスやソケット形状等は念のため実車にてご確認ください。取り付けの際には下記に注意して自己責任にて作業を行ってください。<BR><BR>

*商品によっては極性があります。点灯しない場合は反対に差し込んでください<BR>
*LEDバルブは取り付け環境や取り扱いによって寿命は異なりますので予めご了承下さい。<BR>
*SMDは通常のLEDに比べて精密なチップ構造なため、取り扱いには十分ご注意下さい。<BR>
* 一部の高級車では球切れと判断して、警告灯が点灯することがありますので御注意ください。<BR>
*サイドウインカーの場合は抵抗無しでもハイフラッシュにはなりません。<BR><BR>

■注意<BR>
 * こちらの商品はバルブ1個での金額ですので2個以上必要な方は、その分の個数をご注文くださいませ。<BR> * こちらの商品は汎用品です。出品のタイトルは検索用です。<BR><BR>

